import Authorization from './components/authorization/authorization';
import Home from './components/home/home';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const token = localStorage.getItem('token');

  if (!token) {
    return (
      <Authorization />
    );
  }

  return (
    <Home />
  );
}

export default App;
